webpackJsonp([89842795150484],{7470:function(t,e){t.exports={data:{post:{html:"<p>OK, let's see if this works...</p>\n<p>In an attempt to separate the exciting stuff from the boring stuff, I've moved all my tech-related posts to a separate weblog, <a href=\"http://www.papatech.de/\">PapaTech</a> (running on Typo under Rails). You can decide for yourself whether you find the expat/personal stuff at PapaScott to be exciting, or the hip/technical stuff at PapaTech, or neither (in which case, why are you even reading this?).</p>\n<p>I'm going to try to automatically put summaries of the PapaTech posts at PapaScott, so if things break, that means it's not working yet.</p>",fields:{title:"A Blog Named PapaTech",date:"24 Nov 2005",url:"https://papascott.de/2005-11-24-a-blog-named-papatech/"}}},pathContext:{slug:"/2005-11-24-a-blog-named-papatech/",prev:{fields:{title:"Hamsters on the Autobahn",date:"23 Nov 2005",slug:"/2005-11-23-hamsters-on-the-autobahn/"}},next:{fields:{title:"Google at the Border",date:"24 Nov 2005",slug:"/2005-11-24-google-at-the-border/"}}}}}});
